■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<p><table width="600" border="0" align="center" cellpadding="0" cellspacing="0">  <tr>  <td><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/0000000/0500242-01.jpg" width="600" height="850"><br>  <img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/0000000/0500242-02.jpg" width="600" height="1000"><br>  <img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/0000000/0500242-03.jpg" width="600" height="700"></td>  </tr>  </table>  <br>  <table width="600" align="center" border="0" cellspacing="1" cellpadding="10" bgcolor="#00a0e9">  <tr>  <td bgcolor="#FFFFFF"><font color="#333333" size="-1">  ＜ご使用方法＞<br>  1.洗顔後に、化粧水でお肌を整えます。<br>  2.マスクを袋から取り出し、丁寧に広げてください。<br>  3.マスクを目と口の位置に合わせ、お肌全体に密着させてください。<br>  （口の部分を必ず開けるように貼ってください。）<br>  4.10分～20分間そのままおいた後、マスクをはがしてください。<br>  5.お肌に残った美容液は手で、よくなじませてください。<br>  <br>  ＜成分＞<br>  水、BG、グリセリン、イソペンチルジオール、加水分解プラセンタエキス、グリチルリチン酸2K、イソマルト、PG、DPG、加水分解コラーゲン、ヒアルロン酸Na、アルニカ花エキス、フユボダイジュ花エキス、スギナエキス、セージ葉エキス、セイヨウノコギリソウエキス、ゼニアオイ花エキス、カミツレ花エキス、トウキンセンカ花エキス、セイヨウオトギリソウエキス、ヒドロキシエチルセルロース、キサンタンガム、PEG-20 ソルビタンココエート、ポリソルベート20、カプリル酸グリセリル、フェノキシエタノール、メチルパラベン、香料<br>  <br>  ＜使用上のご注意＞<br>  ●ご使用中お肌に異常を感じた場合、即使用を中止し、医師の診断を受けてください。●眼球、及び目の粘膜の部分に使用しないでください。●日焼け後は、お肌の赤みやほてりがおさまってからご使用ください。●衛生上、一度使用したマスクは繰り返し使用しないでください。●乳幼児へのご使用はしないでください。●目に入ったときは、すぐに水で洗い流してください。●傷、はれもの、湿疹等、異常のある時は使わないでください。<br>  <br>  ＜取扱上のご注意＞<br>  ●直射日光をさけて常温で保管してください。●開封後45日以内にご使用ください。●開封後、液もれのおそれがありますのでチャックを閉めた状態で保管してください。</font></td>  </tr>  </table>  <br>  <table width="600" border="0" align="center" cellpadding="0" cellspacing="0">  <tr>  <td><h1><font color="#333333" size="3">プラセンタ、ヒアルロン酸、コラーゲンの3種の美容成分と9種の天然エキスが潤いとハリのある健康的な素肌へと導きます。   極厚シートでしっかり密着・保湿します。フェイスパック/フェイスマスク/マスクシート/シートパック/スキンケア/フェイスケア/うるおい/潤う/保湿ケア/弾力/湿潤/モイスト/美容液/化粧水/しっとり/お得</font></h1></td>  </tr>  </table></p><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">プラセンタ、ヒアルロン酸、コラーゲンの3種の美容成分と9種の天然エキスが潤いとハリのある健康的な素肌へと導きます。 極厚シートでしっかり密着・保湿します。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">20枚（330ml）</font></td></tr><tr bgcolor="#FFFFFF"><td width="25%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td width="75%" align="left"><font color="#333333" size="-1">商品区分：化粧品<br>販売元：コモライフ（株）</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
