■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>ハリ不足のおでこに。翌朝はがすだけの集中ケアパック!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5315/1014925-01.jpg" width="600" height="600"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【使用方法】<br>洗顔後、お肌の水気を拭き取ります。<br>適量を手にとり、おでこの気になる部分にムラなく薄く塗ってください。<br>10～15分後に表面が乾いているのを確認し、ゆっくりとはがしてください。<br>使用後は化粧水など、普段のお手入れをしてください。<br>※表面が乾いたら、そのままお休みいただくこともできます。<br><br>【ご使用上の注意】<br>●お肌にパックが残った場合は、コットンに水などをふくませて、やさしく拭き取ってください。<br>●使用中または使用後、日光が当たって、赤み・はれ・かゆみ・刺激等の異常が現れた時は使用を中止し、皮膚科専門医等に相談してください。<br>●傷やはれもの、しっしん等、異常のある部位にはお使いにならないでください。<br>●目に入ったときは、直ちに洗い流し、症状によっては眼科医にご相談ください。<br>●高温多湿、極端に低温の場所には保管しないでください。<br>●乳幼児の手の届かないところに保管してください。<br>●天然成分によって着色しているため、保管状況によって色が変わることがありますが、品質には問題ありません。<br>●チューブの口先に中身が固まって出なくなる場合がありますので、使用後はチューブの口元をきれいに拭き取って、必ずしっかりとキャップをしてください。<br>●開封後はお早目にご使用ください。<br><br>【成分】<br>水、ポリビニルアルコール、エタノール、ソルビトール、アクリル酸アルキルコポリマーアンモニウム、ムラサキ根エキス、ポリクオタニウム-51、水溶性コラーゲン、加水分解コラーゲン、セラミド2、セラミド3、(メタクリル酸グリセリルアミドエチル/メタクリル酸ステアリル)コポリマー、カラスムギエキス、ヒアルロン酸Na、加水分解ヒアルロン酸、アセチルヒアルロン酸Na、ユビキノン、チオクト酸、リンゴ果実培養細胞エキス、ジパルミトイルヒドロキシプロリン、アロエベラ葉エキス、セイヨウキズタ葉・茎エキス、セイヨウオトギリソウ花・葉・茎エキス、アルニカ花エキス、クララ根エキス、チャ葉エキス、マグワ根皮エキス、ベニバナ花エキス、スギナエキス、ホップエキス、レモン果実エキス、セイヨウアカマツ球果エキス、ローズマリーエキス、トウキンセンカ花エキス、ローマカミツレ花エキス、フユボダイジュ花エキス、ヒバマタエキス、クレマティスエキス、セイヨウナツユキソウ花エキス、サボンソウエキス、セージ葉エキス、パリエタリアエキス、キュウリ果実エキス、セイヨウニワトコ花エキス、ゼニアオイエキス、オドリコソウエキス、オランダカラシエキス、ニンニクエキス、ゴボウ根エキス、ライム果汁、レモン果汁、オレンジ果汁、グレープフルーツ果実エキス、リンゴエキス、ナツメ果実エキス、サンザシエキス、クチナシ果実エキス、オウゴンエキス、オウバクエキス、オウレンエキス、ジオウエキス、センキュウエキス、シャクヤク根エキス、トウキ根エキス、銅クロロフィリンNa、グリセリン、BG、1.2-ヘキサンジオール、エチルヘキシルグリセリン、ラウロイルグルタミン酸ジ(フィトステリル・オクチルドデシル)、キサンタンガム、レシチン、水添レシチン、ラウリン酸ポリグリセリル-10、フェノキシエタノール</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="241" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5315/1014925-02.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="360" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5315/1014925-03.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="1183" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5315/1014925-04.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="745" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5315/1014925-05.jpg"><br><font size="3"></font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">48種類の植物エキスが配合。パックに含まれた美容エキスがおやすみ中にじんわり浸透します。</font></td></tr></table><br><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">48種類の植物エキスが配合。パックに含まれた美容エキスがおやすみ中にじんわり浸透します。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">30g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：3×3×13cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：39g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">商品区分：化粧品</font><br><font color="#333333" size="-1">発売元：株式会社シェモア</font> </td></tr> <tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
